<OUTPUT_JSON>
[
  {
    "action": "click",
    "selector": "table:has-text(\"order\" i) >> tr >> input[type=checkbox]",
    "text": ""
  },
  {
    "action": "click", 
    "selector": "table:has-text(\"invoice\" i) >> tr >> input[type=checkbox]",
    "text": ""
  },
  {
    "action": "click",
    "selector": "button:has-text(\"match\" i)",
    "text": ""
  },
  {
    "action": "click",
    "selector": "button:has-text(\"record\" i)",
    "text": ""
  }
]
</OUTPUT_JSON>
